import React, { useState } from 'react';
import './Login.css';
// import Link
import { Form, Link } from 'react-router-dom'

// import components
import manIMG from '../../assets/images/man falling.png'

export const LoginPage = () => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

  return (
    <>
    <section className='h-full max-h-[640px] mb-8 xl:mb-24'>
        <div className="flex flex-col lg:flex-row">
            <div data-aos="fade-left" data-aos-duration="1500" className="lg:ml-8 xl:ml-1 flex flex-col items lg:text-left justify-center px-4 lg:px-0 gap-8">
                <h1 className='font-[800] text-4xl mb-6'>
                    <span>Embrace your journey towards well-being.</span>
                </h1>
                <p className='font-[700]'>if you donâ€™t an account <br/> you can <Link className='text-greenColor' to='/Register'>Register Here!</Link></p>
            </div>

            {/* Image */}
            <div data-aos="fade-right" data-aos-duration="1500" className="">
                <img className='floating' src={manIMG} alt="" />
            </div>
            {/* End Image */}

            {/* Form */}
            <form>
                <label for="email">Your email</label>
                <input value={email} type="email" placeholder='yourname@phinmaed.com' id='email' name='email' required />
                <label for="password">Your password</label>
                <input value={pass} type="password" placeholder='*******' id='password' name='password' required />
                <button>Log In</button>
            </form>
            {/* End Form */}
        </div>
    </section>
    </>
  )
}

export default LoginPage
